import React, { useEffect, useState } from 'react';
import a from './../exampl/Header.module.css'
import s from './Navbar.module.css'

import tg from './../../img/tg.png'
import email from './../../img/email.png'
import gh from './../../img/gh.png'


const Footer = (props) => {
     return (
          <div className='wrapper'>
          <div className='content'>
              
            
         <div  ><a href='https://t.me/kirill212121555'><img  className={s.pi} src={tg} alt="КАРТИНКА"></img></a></div>
               <div  className="qwe"><a href='mailto:kirill2121555@gmail.com?'><img  className={s.pie} src={email} alt="КАРТИНКА"></img></a> </div>
            
                <div  className="qwe"><a href='https://github.com/kirill2121555'><img  className={s.pie} src={gh} alt="КАРТИНКА"></img></a></div>
                </div></div>
       
        



     );
}

export default Footer
